import React from 'react'
import Link from '@material-ui/core/Link';
//import Maapform from './RangeCircleform'
export default function Home() {
    const useStyles = makeStyles(theme => ({
        paper: {
            marginTop: theme.spacing(8),
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
        },
        avatar: {
            margin: theme.spacing(1),
            backgroundColor: theme.palette.secondary.main,
        },
        form: {
            width: '100%', // Fix IE 11 issue.
            marginTop: theme.spacing(1),
        },
        submit: {
            margin: theme.spacing(3, 0, 2),
        },
    }));
    const classes = useStyles();
    return (
        <div>
            <div className="row" style={{ background: "blue", width: "100%" }}>
                <div className="col-lg-10 col-md-10 col-sm-10 col-xs-10 " style={{ paddingLeft: "70px"}} >
                    <h2>E-Learning</h2>
                </div>
                <div className="col-lg-2 col-md-2 col-sm-2 col-xs-2">
                <Link href="/admin/SignupPage/" variant="body2" style={{ color: "red",fontSize:"20px"}}>
                {"SignIn"}
              </Link>
            </div>
            </div>
            <div>
            <Container component="main" maxWidth="xs" style={{ background: "#FFFDD0" }}>
                <h2> Add Users Course</h2>
                <form onSubmit={handleSubmit} className={classes.form} noValidate>
                   
                    <Button
                        type="submit"
                        fullWidth
                        variant="contained"
                        color="primary"
                        className={classes.submit}

                    >
                        Add Course
            </Button>
                </form>
            </Container>
        </div>

        </div>
    )
}
